import React, {useState} from "react";

function App() {
    //const state = useState(0)
    let likes = 5;

    function increment(){
        likes++;
        console.log(likes);
    }

    return(
        <div className="App">
            <h1>{likes}</h1>
            <button onClick={increment}>Increment</button>
            <button onClick={() => likes--}>Decrement</button>
        </div>
    );
}

export default App;
